                            instance.thumbs.find('a.itm'+pos).addClass('selected');

                            $(this).trigger("currentPosition", function( pos ) {
                                var txt = Math.ceil((pos+1))+"&#47;"+$(this).children().length;
                                $('.product-count').html(txt);
                            });
